TV、雑誌などでも多数紹介された有名な<br>イタリア「サンタ・マドンナ・デル・ギッサロ教会」<br><br>
貴重な自転車用お守りを今回『数量限定』で入荷いたしました。<br>
もちろん正規品及び新品となります。<br>軽量仕様でロードバイクにも優しい。<br>
自転車本体フレーム及びサドル棒へ装着するタイプとなります。<br>★安全ピンにて取付けるコインタイプもございます。<br><br>
【サイズ】<br>
ヘッド部分（縦：27mm x 横：27mm）<br>
全長：14.3cm<br>
取付可能幅：約8cm～13cm<br><br>
・2016年現行品は画像と異なり取り付け穴が5つとなっております。<br>
・教会側のデザイン変更等に伴い画像とお送り商品が異なる場合がございます。<br>予めご了承のほどよろしくお願い申し上げます。<br><br>
【重量】<br>
約14g<br><br>
※多少の誤差はご了承下さい。<br><br>

【付属品】<br>
取付ネジ<br>
教会紹介オリジナルパンフレット（英語又はイタリア語）<br>
※パンフレットデザインは入荷時期により画像と異なる場合がございます。<br><br>

【発送方法】<br>
こちらの商品は、「メール便」にてお送りいたします。<br>
「代引き・時間指定不可商品」となります。<br>
※別途＋500円（全国一律）にて宅急便対応も可能です。<br>ご希望の場合は、備考欄へご記入下さい。<br><br>


【ご注意】<br>
ご自身で自転車に取付けて頂く商品となります。簡単に装着可能です。<br>
スクリューネジ式<br>
何度も装着を繰り返しますと破損の恐れがあります。<br>
製品の特性上、開封後のご返品は致しかねます。<br><br>★複数個ご購入割引は、ご注文後金額訂正をさせて頂きます。<CENTER> <IMG SRC=http://image.rakuten.co.jp/shibaryu/cabinet/kanban/02682908/imgrc0070171044.jpg WIDTH=800 HEIGHT=50></CENTER>
